import React from 'react';

function List(props) {
    return (
        <div className='list'>
            <ul>
                <li>
                    <p>1.17</p>
                    <p>강남역 커피빈</p>
                    <p>-5,200</p>
                </li>
            </ul>
        </div>
    );
}

export default List;
